IF EXISTS(SELECT 1 FROM sys.tables WHERE object_id = OBJECT_ID('table_password_data'))
BEGIN;
    DROP TABLE [table_password_data];
END;
GO

CREATE TABLE [table_password_data] (
    [table_password_dataID] INTEGER NOT NULL IDENTITY(1, 1),
    [numberrange] VARCHAR (10) NULL,
    PRIMARY KEY ([table_password_dataID])
);
GO

